var loginURL = 'http://192.168.2.24:4000/login';

function reducer (state, action){
    switch(action.type){
        case 'login':
            return action.payload;
        case 'register':
            console.log(action.payload)
            return action.payload;
        default:
            throw new Error('Unknown action type:'+action.type);
    }
}

export default reducer;
